import React from "react";
import { Router } from "react-router-dom";
import Navbar from "./components/Navbar";
import { ThemeProvider } from "./context/ThemeContext";
import Home from "./routers/Home";

function App() {
  return (
    <ThemeProvider>
      <Navbar/>
      <Router>
         <Router path='/' element ={<Home/>} />
      </Router>
    </ThemeProvider>
  );
}

export default App;
